import { render } from '@testing-library/react';
import React from 'react';
import './styles/main.css';
import Movie from './components/movie';

function App() {

  return (
    <div className="container">
      <div className="input-container">
        <label>Search for a Movie</label>
        <input type="text"></input>
      </div>

      <div className="movies-container">
          <Movie title="Avengers"></Movie>
          <Movie title="Black Widow"></Movie>
          <Movie title="Frozen 2"></Movie>
          <Movie title="Scary Movie"></Movie>
          <Movie title="Star Wars"></Movie>
          <Movie title="Santana"></Movie>
          <Movie title="Date Movie"></Movie>
          <Movie title="Bad Boys"></Movie>
      </div>

    </div>

  );
}

export default App;
